import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { BrowserRouter ,Routes , Route } from 'react-router-dom';

const root = ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={ <App /> }>
        </Route>
      </Routes>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
